import React, { useState } from "react";

const OutputNode = ({ i }) => {
  const [color, setColor] = useState("blue");

  const changeColor = (newColor) => setColor(newColor);

  return (
    <svg>
      <circle
        cx="50"
        cy="50"
        r="12"
        fill="coral"
        onMouseOver={() => changeColor("green")}
        onMouseOut={() => changeColor("blue")}
      />
      <g key={i}>
        <circle
          cx={(i + 1) * (1000 / 9)}
          cy={0}
          r="12"
          fill="coral"
          onMouseOver={() => changeColor("green")}
          onMouseOut={() => changeColor("blue")}
        />
      </g>
    </svg>
  );
};

export default OutputNode;
